# ============================================================================
# LOOKUP INDEX (Auto-generated)
# ============================================================================

_MANUFACTURER_INDEX = None

def _build_manufacturer_index():
    """Build inverted index on first access."""
    global _MANUFACTURER_INDEX
    if _MANUFACTURER_INDEX is not None:
        return

    _MANUFACTURER_INDEX = {}
    for entry in STRUCTURED_DATA:
        for manufacturer in entry['manufacturers']:
            mfg_lower = manufacturer.lower()
            if mfg_lower not in _MANUFACTURER_INDEX:
                _MANUFACTURER_INDEX[mfg_lower] = []
            _MANUFACTURER_INDEX[mfg_lower].append({
                'group': entry['group'],
                'group_name': entry['group_name'],
                'domain': entry['domain'],
                'subdomain': entry['subdomain']
            })

# ============================================================================
# HELPER FUNCTIONS
# ============================================================================

def get_structured_data():
    """Get the complete hierarchical data structure."""
    return STRUCTURED_DATA

def lookup_manufacturer(manufacturer: str) -> list:
    """Find all contexts where a manufacturer appears."""
    _build_manufacturer_index()
    return _MANUFACTURER_INDEX.get(manufacturer.lower(), [])

def get_all_manufacturers() -> set:
    """Get set of all unique manufacturers (lowercase)."""
    _build_manufacturer_index()
    return set(_MANUFACTURER_INDEX.keys())

def get_manufacturers_for_subdomain(domain: str, subdomain: str) -> list:
    """Get manufacturers for a specific domain/subdomain."""
    for entry in STRUCTURED_DATA:
        if entry['domain'] == domain and entry['subdomain'] == subdomain:
            return entry['manufacturers']
    return []

def get_equipment_terms() -> set:
    """Extract all equipment terms (domain and subdomain names)."""
    terms = set()
    for entry in STRUCTURED_DATA:
        terms.add(entry['domain'].lower())
        terms.add(entry['subdomain'].lower())
    return terms

def search_manufacturers(query: str) -> list:
    """Search manufacturers by partial name match."""
    _build_manufacturer_index()
    query_lower = query.lower()
    results = []
    for mfg, contexts in _MANUFACTURER_INDEX.items():
        if query_lower in mfg:
            results.append((mfg, contexts))
    return results

def get_statistics() -> dict:
    """Get statistics about the data."""
    _build_manufacturer_index()

    groups = set(entry['group'] for entry in STRUCTURED_DATA)
    domains = set(entry['domain'] for entry in STRUCTURED_DATA)
    subdomains = set(entry['subdomain'] for entry in STRUCTURED_DATA)

    return {
        'total_manufacturers': len(_MANUFACTURER_INDEX),
        'total_contexts': len(STRUCTURED_DATA),
        'total_groups': len(groups),
        'total_domains': len(domains),
        'total_subdomains': len(subdomains),
        'groups': sorted(list(groups))
    }

# Backwards compatibility
def load_manufacturers():
    """DEPRECATED: Use get_all_manufacturers() instead."""
    return get_all_manufacturers()

def load_equipment_terms():
    """DEPRECATED: Use get_equipment_terms() instead."""
    return get_equipment_terms()
